import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the main content to be present (using skip-link anchor as landmark)
    await page.waitForSelector('a.skip-link');

    // Try to find the "Electronics" category card (not just a link)
    // Use XPath to select the category card with text "Electronics"
    const [electronicsCard] = await page.$x("//div[contains(@class,'category-card')][contains(.,'Electronics')]");
    if (electronicsCard) {
      await electronicsCard.scrollIntoViewIfNeeded();
      await electronicsCard.click();
      await page.waitForTimeout(800); // Wait for dynamic content to load
    } else {
      // Fallback: Try to click the first visible <a> with exact text "Electronics"
      const electronicsLink = await page.locator('a', { hasText: /^Electronics$/ }).first();
      if (await electronicsLink.isVisible()) {
        await electronicsLink.scrollIntoViewIfNeeded();
        await electronicsLink.click();
        await page.waitForTimeout(800);
      } else {
        throw new Error('Could not find Electronics category card or link');
      }
    }

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Wait for a heading or section indicating Electronics products are shown
    // Try to get the heading text
    let headingText = '';
    try {
      // Try h2
      const heading = await page.locator('h2').first();
      if (await heading.isVisible()) {
        headingText = await heading.textContent();
      }
    } catch {}

    // Extract product titles in the electronics category (look for product cards)
    const productTitles = [];
    const productCards = await page.$$('.product-card');
    for (const card of productCards) {
      const titleEl = await card.$('.product-title');
      if (titleEl) {
        const title = await titleEl.textContent();
        if (title) productTitles.push(title.trim());
      }
    }

    return {
      success: true,
      action: "Navigated to Electronics category using category card or link and verified product listing.",
      extractedData: {
        headingText: headingText ? headingText.trim() : null,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
